                 ");
                WriteLiteral(@"                   </div>
                                    <div class=""col-sm-10 text-justify"">
                                        <p>At Student File System, accessible from SFS, one of our main priorities is the privacy of our visitors. This Privacy Policy document contains types of information that is collected and recorded by Student File System and how we use it.</p>

                                        <p>If you have additional questions or require more information about our Privacy Policy, do not hesitate to contact us.</p>

                                        <p>This Privacy Policy applies only to our online activities and is valid for visitors to our website with regards to the information that they shared and/or collect in Student File System. This policy is not applicable to any information collected offline or via channels other than this website.</p>
                                        <span id=""dots"">...</span>
                                        <span id=""more"">
");
                WriteLiteral(@"                                            <h5>Consent</h5>

                                            <p>By using our website, you hereby consent to our Privacy Policy and agree to its terms.</p>

                                            <h5>Information we collect</h5>

                                            <p>The personal information that you are asked to provide, and the reasons why you are asked to provide it, will be made clear to you at the point we ask you to provide your personal information.</p>
                                            <p>If you contact us directly, we may receive additional information about you such as your name, email address, phone number, the contents of the message and/or attachments you may send us, and any other information you may choose to provide.</p>
                                            <p>When you register for an Account, we may ask for your contact information, including items such as name, company name, address, email address, and telephon");
                WriteLiteral(@"e number.</p>

                                            <h5>How we use your information</h5>

                                            <p>We use the information we collect in various ways, including to:</p>

                                            <ul>
                                                <li>Provide, operate, and maintain our website</li>
                                                <li>Improve, personalize, and expand our website</li>
                                                <li>Understand and analyze how you use our website</li>
                                                <li>Develop new products, services, features, and functionality</li>
                                                <li>Communicate with you, either directly or through one of our partners, including for customer service, to provide you with updates and other information relating to the website, and for marketing and promotional purposes</li>
                                                <");
                WriteLiteral(@"li>Send you emails</li>
                                                <li>Find and prevent fraud</li>
                                            </ul>

                                            <h5>Log Files</h5>

                                            <p>Student File System follows a standard procedure of using log files. These files log visitors when they visit websites. All hosting companies do this and a part of hosting services' analytics. The information collected by log files include internet protocol (IP) addresses, browser type, Internet Service Provider (ISP), date and time stamp, referring/exit pages, and possibly the number of clicks. These are not linked to any information that is personally identifiable. The purpose of the information is for analyzing trends, administering the site, tracking users' movement on the website, and gathering demographic information.</p>

                                            <h5>Cookies and Web Beacons</h5>

                                 ");
                WriteLiteral(@"           <p>Like any other website, Student File System uses ""cookies"". These cookies are used to store information including visitors' preferences, and the pages on the website that the visitor accessed or visited. The information is used to optimize the users' experience by customizing our web page content based on visitors' browser type and/or other information.</p>



                                            <h5>Advertising Partners Privacy Policies</h5>

                                            <P>You may consult this list to find the Privacy Policy for each of the advertising partners of Student File System.</P>

                                            <p>Third-party ad servers or ad networks uses technologies like cookies, JavaScript, or Web Beacons that are used in their respective advertisements and links that appear on Student File System, which are sent directly to users' browser. They automatically receive your IP address when this occurs. These technologies are used to measure");
                WriteLiteral(@" the effectiveness of their advertising campaigns and/or to personalize the advertising content that you see on websites that you visit.</p>

                                            <p>Note that Student File System has no access to or control over these cookies that are used by third-party advertisers.</p>

                                            <h5>Third Party Privacy Policies</h5>

                                            <p>Student File System's Privacy Policy does not apply to other advertisers or websites. Thus, we are advising you to consult the respective Privacy Policies of these third-party ad servers for more detailed information. It may include their practices and instructions about how to opt-out of certain options. </p>

                                            <p>You can choose to disable cookies through your individual browser options. To know more detailed information about cookie management with specific web browsers, it can be found at the browsers' respective websites");
                WriteLiteral(@".</p>

                                            <h5>CCPA Privacy Rights (Do Not Sell My Personal Information)</h5>

                                            <p>Under the CCPA, among other rights, California consumers have the right to:</p>
                                            <p>Request that a business that collects a consumer's personal data disclose the categories and specific pieces of personal data that a business has collected about consumers.</p>
                                            <p>Request that a business delete any personal data about the consumer that a business has collected.</p>
                                            <p>Request that a business that sells a consumer's personal data, not sell the consumer's personal data.</p>
                                            <p>If you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us.</p>

                                            <h5>GDPR Data P");
                WriteLiteral(@"rotection Rights</h5>

